import React, { useState } from "react";

function NumberInc(){

    const[state,setState]=useState(0)

    const inc=()=>{
        setState(state +1)
    }

    const dec=()=>{
        setState(state -1)
    }
   

    return(

        <div>
       <h3>The count is {state}</h3>
       <button onClick={inc}>Increment</button>
       <button onClick={dec}>Decremet</button>

        </div>
    )
}
